DareDorm - So Fresh

Added: November 19, 2010

This episode of daredorm we got a couple of really cute girls that, for some reason, is their first time doing something with another girl. Everything starts nice and sensual when, all of a sudden, the roommate comes in from a club with a guy that she wanted to bang. Now everything is not so slow anymore and we get a nice threesome of the girls in bed. At the beginning the dude is just watching but, come on, how long can a guy just look without joining in. The fuck fest that follows is legendary.
